import React from 'react';
import styled from 'styled-components';

const BoardContainer = styled.div`
  background: #fff;
  width: 500px;
  height: 500px;
  border-radius: 16px;
  box-shadow: -6px 10px 30px 4px #00000033;
  border: 20px solid #fff;
`


const Cell = styled.div`
 background-color: #fff;
`

function App() {
  return (
    <BoardContainer>
      <Board>
        <Cell />
        <Cell />
        <Cell />
      </Board>
    </BoardContainer>
  );
}

export default App;
